,1061:{c:0,f:1138659,gn:-70,gs:70,ge:-160,gw:160,mlh:18,mll:1,tlh:8,tll:7,mt:0,tt:3,mag:1200,scale:'Epoch',b:-323200000,bsd:400000,e:-298900000,esd:200000,h:'Pennsylvanian',s:'Winged insects radiate suddenly; some (esp.Protodonata and Palaeodictyoptera) are quite large.Amphibians common and diverse. First reptiles andcoal forests (c:0,f:1138659,gn:-70,gs:70,ge:-160,gw:160,mlh:18,mll:1,tlh:8,tll:7,mt:0,tt:3,mag:1200,scale trees, ferns, club trees, giant horsetails, Cordaites, etc.). Highest-everatmospheric oxygen levels. Goniatites, brachiopods, bryozoa, bivalves, and corals plentiful in the seas and oceans. Testate forams proliferate. Uralian orogeny in Europe and Asia. Variscan orogenyoccurs towards middle and late Mississippian Periods.'}
,1062:{c:0,f:1138659,gn:-70,gs:70,ge:-160,gw:160,mlh:18,mll:1,tlh:8,tll:7,mt:0,tt:3,mag:1200,scale:'Epoch',b:-358900000,bsd:400000,e:-323200000,esd:400000,h:'Mississippian',s:'Large primitive trees, first land vertebrates, and amphibious sea-scorpions live amid coal-forming coastal swamps. Lobe-finned rhizodonts are dominant big fresh-water predators. In the oceans, early sharks are common and quite diverse;echinoderms (especially crinoids and blastoids) abundant. Corals, bryozoa, goniatites and brachiopods (Productida, Spiriferida, etc.) very common, but trilobites and nautiloids decline.Glaciation in East Gondwana. Tuhua Orogeny in New Zealand tapers off.'}
